  return (
    <Layout>
      <div className="container">
      <div className='row'>  
    {comments.map((comments) => {
      return(
        <div className='col.sm-3' >
          <div className="card"></div>
        </div>
      )
    }
    )}


    </div>
      </div>
    </Layout>
    
  )
}
